Narito ang isang halimbawa ng Java application na kumokonekta sa isang PostgreSQL database, nagsasagawa ng CRUD operations sa isang table na "tao", at may kasamang suporta para sa mga transaksyon at paghawak ng error:

```java
import java.sql.*;

public class PostgreSQLExample {
    private static final String DB_URL = "jdbc:postgresql://localhost:5432/your_database_name";
    private static final String USER = "your_username";
    private static final String PASS = "your_password";

    public static void main(String[] args) {
        Connection conn = null;
        try {
            // Konektahin sa database
            conn = DriverManager.getConnection(DB_URL, USER, PASS);

            // Gawin ang mga CRUD operations
            createPerson(conn, "Juan", "Dela Cruz", 25);
            readPerson(conn);
            updatePerson(conn, 1, "Pedro", "Santos", 30);
            deletePerson(conn, 2);

            // Gawin ang transaksyon
            conn.setAutoCommit(false);
            createPerson(conn, "Maria", "Garcia", 28);
            updatePerson(conn, 3, "Ana", "Reyes", 32);
            conn.commit();

        } catch (SQLException e) {
            e.printStackTrace();
            if (conn != null) {
                try {
                    conn.rollback();
                } catch (SQLException ex) {
                    ex.printStackTrace();
                }
            }
        } finally {
            // Isara ang koneksyon sa database
            if (conn != null) {
                try {
                    conn.close();
                } catch (SQLException e) {
                    e.printStackTrace();
                }
            }
        }
    }

    private static void createPerson(Connection conn, String firstName, String lastName, int age) throws SQLException {
        String sql = "INSERT INTO tao (first_name, last_name, age) VALUES (?, ?, ?)";
        PreparedStatement statement = conn.prepareStatement(sql);
        statement.setString(1, firstName);
        statement.setString(2, lastName);
        statement.setInt(3, age);
        statement.executeUpdate();
        statement.close();
        System.out.println("Person created successfully.");
    }

    private static void readPerson(Connection conn) throws SQLException {
        String sql = "SELECT * FROM tao";
        Statement statement = conn.createStatement();
        ResultSet resultSet = statement.executeQuery(sql);
        while (resultSet.next()) {
            int id = resultSet.getInt("id");
            String firstName = resultSet.getString("first_name");
            String lastName = resultSet.getString("last_name");
            int age = resultSet.getInt("age");
            System.out.println("ID: " + id + ", Name: " + firstName + " " + lastName + ", Age: " + age);
        }
        resultSet.close();
        statement.close();
    }

    private static void updatePerson(Connection conn, int id, String firstName, String lastName, int age) throws SQLException {
        String sql = "UPDATE tao SET first_name = ?, last_name = ?, age = ? WHERE id = ?";
        PreparedStatement statement = conn.prepareStatement(sql);
        statement.setString(1, firstName);
        statement.setString(2, lastName);
        statement.setInt(3, age);
        statement.setInt(4, id);
        statement.executeUpdate();
        statement.close();
        System.out.println("Person updated successfully.");
    }

    private static void deletePerson(Connection conn, int id) throws SQLException {
        String sql = "DELETE FROM tao WHERE id = ?";
        PreparedStatement statement = conn.prepareStatement(sql);
        statement.setInt(1, id);
        statement.executeUpdate();
        statement.close();
        System.out.println("Person deleted successfully.");
    }
}
```

Siguraduhin na palitan ang `DB_URL`, `USER`, at `PASS` na may tamang mga detalye ng iyong PostgreSQL database. Gumawa rin ng isang table na "tao" na may mga kolum na "id" (integer), "first_name" (varchar), "last_name" (varchar), at "age" (integer).

Ang mga `createPerson`, `readPerson`, `updatePerson`, at `deletePerson` methods ay naglalaman ng mga SQL queries para sa mga CRUD operations. Ang `main` method ay naglalaman ng mga tawag sa mga methods na ito, kasama ang mga transaksyon at paghawak ng error.

Narito ang isang halimbawa ng Golang application na gumagawa ng proxy server na nagpapasa ng mga HTTP request sa isa pang server at naglilista ng mga kahilingan at mga detalye ng pagtugon sa isang MySQL database. Ang application na ito ay may kakayahan rin na magpatupad ng rate limiting upang maiwasan ang pag-abuso sa proxy server.

Una, kailangan mong mag-install ng mga sumusunod na dependencies sa iyong Go environment:

```shell
go get github.com/gorilla/mux
go get github.com/jinzhu/gorm
go get github.com/go-sql-driver/mysql
go get golang.org/x/time/rate
```

Pagkatapos nito, maaari mo nang simulan ang paglikha ng iyong proxy server application. Narito ang isang halimbawa ng kodigo:

```go
package main

import (
	"database/sql"
	"fmt"
	"log"
	"net/http"
	"time"

	"github.com/gorilla/mux"
	"github.com/jinzhu/gorm"
	_ "github.com/jinzhu/gorm/dialects/mysql"
	"golang.org/x/time/rate"
)

type RequestLog struct {
	gorm.Model
	Method      string
	URL         string
	StatusCode  int
	Response    string
	CreatedAt   time.Time
}

func main() {
	db, err := gorm.Open("mysql", "user:password@tcp(127.0.0.1:3306)/database?charset=utf8&parseTime=True&loc=Local")
	if err != nil {
		log.Fatal(err)
	}
	defer db.Close()

	db.AutoMigrate(&RequestLog{})

	r := mux.NewRouter()
	r.HandleFunc("/", rateLimit(proxyHandler, 2, 5)).Methods("GET")

	log.Fatal(http.ListenAndServe(":8080", r))
}

func proxyHandler(w http.ResponseWriter, r *http.Request) {
	// Ito ang bahagi kung saan maaari mong ipasa ang HTTP request sa isa pang server
	// at kunin ang response nito. Maaari mong gamitin ang http package ng Go para dito.

	// Halimbawa:
	resp, err := http.Get("http://example.com")
	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}
	defer resp.Body.Close()

	// Ito ang bahagi kung saan maaari mong i-log ang kahilingan at mga detalye ng pagtugon
	// sa iyong MySQL database.
	// Maaari mong gamitin ang gorm package ng Go para dito.

	// Halimbawa:
	db, err := gorm.Open("mysql", "user:password@tcp(127.0.0.1:3306)/database?charset=utf8&parseTime=True&loc=Local")
	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}
	defer db.Close()

	requestLog := RequestLog{
		Method:     r.Method,
		URL:        r.URL.String(),
		StatusCode: resp.StatusCode,
		Response:   resp.Status,
		CreatedAt:  time.Now(),
	}

	db.Create(&requestLog)

	// Ito ang bahagi kung saan maaari mong i-return ang response mula sa server na pinagkuhanan
	// ng HTTP request.
	// Maaari mong gamitin ang http package ng Go para dito.

	// Halimbawa:
	w.WriteHeader(resp.StatusCode)
	w.Write([]byte(resp.Status))
}

func rateLimit(next http.HandlerFunc, requestsPerSecond float64, burst int) http.HandlerFunc {
	limiter := rate.NewLimiter(rate.Limit(requestsPerSecond), burst)

	return func(w http.ResponseWriter, r *http.Request) {
		if !limiter.Allow() {
			http.Error(w, "Rate limit exceeded", http.StatusTooManyRequests)
			return
		}

		next(w, r)
	}
}
```

Siguraduhin na palitan ang mga sumusunod na mga detalye sa kodigo:

- `"user:password@tcp(127.0.0.1:3306)/database?charset=utf8&parseTime=True&loc=Local"` - Palitan ang `user`, `password`, `127.0.0.1:3306`, at `database` ng tamang mga detalye ng iyong MySQL database.
- `http://example.com` - Palitan ang URL na ito ng URL ng server na nais mong gamitin bilang target ng proxy server.
- `rateLimit(proxyHandler, 2, 5)` - Palitan ang `2` at `5` ng tamang mga halaga ng rate limit na nais mong ipatup

